            name="title"
            // value={note.title}
            // onChange={inputEvent}
            placeholder="Title"
            autoComplete="off"
          />
          )
          <textarea
            type="text"
            placeholder="Write  a note..."
            name="content"
            // value={note.content}
            // onChange={inputEvent}
            // onClick={setExpand}

            // rows=""
            // column=""
          ></textarea>
          (
          <Button>
            <AddIcon className="plus_sign" />
          </Button>
        </form>
      </div>
    </>
  );
};

export default EditNotes;
